import React from 'react';
import Todos from './components/Todos';
import './App.css';

function App() {
  state = {
    todos: [
      {
        title: 'Take out the tra'
      }
    ]
  }
  return (
    <div className="App">
      <Todos />
    </div>
  );
}

export default App;
